import { Link } from 'react-router-dom'

function Header() {
  return (
    <nav>
      <Link to="/">Accueil</Link>
      <Link to="/Home/Logement">Nos logements</Link>
      <Link to="/About">A propos</Link>
    </nav>
  )
}

export default Header
